'use strict';

angular.module('myApp.view1', ['ngRoute', 'ngMaterial', 'ngMessages', 'ui.mask', 'flow'])

.config(['$routeProvider', function($routeProvider) {
  $routeProvider.when('/view1', {
    templateUrl: 'view1/view1.html',
    controller: 'ContactList'
  });
}])

.controller('ContactList', [ '$scope', '$log', '$document', function($scope, $log, $document) {

  $scope.file = {};

  $scope.user = {
    name: '',
    phone: '',
    photo: photoPlaceholder,
    sex: 'Не вибрано',
    blacklist: false
  };

  $scope.validStatus = true;

  $scope.users = [
    {photo: myPhoto, name: 'Денис', phone:'+380(99)99-99-999', sex: 'Мужчина', blacklist: 'lock_open' }
  ];

  $scope.someHandlerMethod = function ( $file, $event, $flow ) {
    $log.log($file);
    $log.log($event);
    $log.log($flow.files[0]);
  };

  $scope.sortBy = '';

  $scope.setSort = function (by) {
    $scope.sortBy = by;
  };

  $scope.addUser = function () {
    $log.log($scope.file);
    var photo = $document[0].getElementById('photo').src;
    $log.log(photo);
    if( photo == '') photo = photoPlaceholder;
    if( $scope.user.blacklist ){
      var blackList = 'lock';
    } else {
      var blackList = 'lock_open';
    }
    $scope.newUser = {
      name: $scope.user.name,
      phone: $scope.user.phone.replace(/([\d]{2})([\d]{3})([\d]{2})([\d]{2})/, function (match, p1, p2, p3, p4, offset, string) {
        return '+380('+p1+')'+p2+'-'+p3+'-'+p4;
      }),
      photo: photo,
      sex: $scope.user.sex,
      blacklist: blackList
    };
    $scope.user = {
      name: '',
      phone: '',
      photo: photoPlaceholder,
      sex: 'Не вибрано',
      blacklist: false
    };
    $scope.users.push($scope.newUser);
  };

  $scope.removeUser = function(userIndex) {
      $log.log(userIndex);
    $scope.users.splice(userIndex, 1);
  };

  $scope.showHints = false;

  $scope.listenInput = function (file) {
    $scope.setPreviewImg(file);
    console.log(file);
  };
  $scope.setPreviewImg = function (fileInput) {
    var path = angular.element(fileInput).val();
    var uploadText = angular.element(fileInput).siblings('.file-upload-text');
    if(!path) {
      angular.element(uploadText).val('');
    } else {
      path = path.replace(/^C:\\fakepath\\/, "");
      angular.element(uploadText).val(path);
    }
    console.log(fileInput, path, uploadText);
    $scope.showPreview(fileInput, path, uploadText);
  };

  $scope.showPreview = function (fileInput, path, uploadText) {
    var file = angular.element(fileInput)[0].files;
    console.log(file);
    if( file && file[0] ) {
      var reader = new FileReader();

      reader.onload = function (e) {
        var previewImg = angular.element(fileInput).parent().siblings();
        var img = angular.element(previewImg).find('img');
        if(img.length == 0) {
          angular.element(previewImg).html('<img src="' + e.target.result + '" alt=""/>');
        } else {
          img.attr('src', e.target.result);
        }
        uploadText.val(path);
        console.log(e);
        reader.onloadstart = function() {
          $(uploadText).val('uploading..');
        };

        reader.readAsDataURL(file[0]);
      }
    }
  }

}]);

var myPhoto = 'data:image/jpeg;base64,';
var photoPlaceholder = 'data:image/png;base64,';